import React, { Component } from 'react';
import { Container, Row, Col, Form, Table, Button } from 'react-bootstrap';
import Link from 'next/link'

class Section extends Component {

    constructor (props) {
        super(props);
        let today = new Date();
        let year = today.getFullYear();
        let day = today.getMonth() + 1;
        this.state = {
            year: year,
            month: day,
        };
        this.onChangeYear = this.onChangeYear.bind(this);
        this.onChangeMonth = this.onChangeMonth.bind(this);

    }

    onChangeYear (e) {
        this.setState ({
            year: e.target.value
        });
    }

    onChangeMonth (e) {
        this.setState ({
            month: e.target.value
        });
    }

    render () {

        let today = new Date();
        let yearAgo = today.getFullYear()-1;
        let yearThis = today.getFullYear();
        let yearLater = today.getFullYear()+1;

        return (<div class="children-box">
            <Container>
                <Row className="monthly-input">
                    <Col md="auto">対象年月</Col>
                    <Col md="auto">
                        <Form.Control as="select" defaultValue={ yearThis } onChange={ this.onChangeYear }>
                            <option>{ yearAgo }</option>
                            <option>{ yearThis }</option>
                            <option>{ yearLater }</option>
                        </Form.Control>
                    </Col>
                    <Col md="auto">年</Col>
                    <Col md="auto">
                        <Form.Control as="select" defaultValue={ this.state.month } onChange={ this.onChangeMonth }>
                            <option value="1">1</option>
                            <option value="2">2</option>
                            <option value="3">3</option>
                            <option value="4">4</option>
                            <option value="5">5</option>
                            <option value="6">6</option>
                            <option value="7">7</option>
                            <option value="8">8</option>
                            <option value="9">9</option>
                            <option value="10">10</option>
                            <option value="11">11</option>
                            <option value="12">12</option>
                        </Form.Control>
                    </Col>
                    <Col md="auto">月</Col>
                </Row>
                <hr/>
                <Container>
                    <Form.Row inline>
                            <Form.Label  column lg={1} >DA1</Form.Label>
                            <Form.Label  column lg={1}>開始時間</Form.Label>
                            <Col lg={2}>
                                <Form.Control size="sm" type="time" placeholder="" />
                            </Col>
                    </Form.Row>
                </Container>
                <Table bordered size="sm">
                <tbody>
                    <tr>
                        <td>
                            <Form.Label>DA1</Form.Label>                            
                        </td>
                        <td>
                            <Form.Label>開始日</Form.Label>                            
                        </td>
                        <td>
                            <Form.Control type="date" placeholder="" className="setting-form" />
                        </td>
                    </tr>
                </tbody>
                </Table>
            </Container>

            <a href="" class="btn btn--orange btn--circle btn--circle-a btn--shadow">保存</a>
        </div>);
    }
}

export default Section;
